import React from "react";
import Welcome from "./welcome";

class StartPage extends React.Component {
   render() {
      const { handleContinue1 } = this.props;

      return (
         <div>
            <Welcome />
            <button onClick={handleContinue1}>Продолжить</button>
         </div>
      );
   }
}

export default StartPage;
